import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route} from "react-router-dom";
import DisplayImages from './component/DisplayImages';
import CircuteNavbar from './component/CircuteNavbar';
import Bag from './component/Bag';
import Sugar from './component/Sugar';
import Noodels from './component/Noodels';
import VRModel from './component/VRModel';
import VREx from './component/VREx';
import ARView from './component/ARView';

function App() {
  return (
    <div className="App">
 <Router>
   < CircuteNavbar />
 <Route exact path="/" component={ DisplayImages } /> 
 <Route exact path="/sugar" component={ Sugar } />
<Route exact path="/bag" component={ Bag } />
<Route exact path="/noodels" component={ Noodels } />
<Route exact path="/3DVIEW" component={ VRModel } />
<Route exact path="/ARVIEW" component={ VREx } />
   </Router>
    </div>
  );
}

export default App;
